import React from "react";
import { BrowserRouter, Routea, Switch } from "react-router-dom";
import Login from "./pages/Login";

export default function Routes() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact Component={Login} />
      </Switch>
    </BrowserRouter>
  );
}
